  \"Oceanographic and surface meteorological data collected from station MTU Buoy
  by Michigan Technological University and assembled by Great Lakes Observing System
  (GLOS) in the Great Lakes region from 2014-07-01 to 2015-07-01 (NODC Accession 0123644)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:45.578104\",\n\t\"name\": \"oceanographic-and-surface-meteorological-data-collected-from-station-mtu-buoy-by-michigan-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0123644 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). Michigan Technological University collected the data from their in-situ
  moored station named MTU Buoy in the Great Lakes. GLOS, which assembles data from
  Michigan Technological University and other sub-regional coastal and ocean observing
  systems of the Great Lakes region of the United States, submitted the data to NODC
  as part of NODC's Integrated Ocean Observing System Data Assembly Centers (IOOS
  DACs) Data Stewardship Program. Each month, NODC adds to the Accession the data
  collected during the previous month.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
